import React from "react";
import "./menuBar.scss";
import Search from "../../images/search.png"

export default function MenuBar() {
    return (
        <div className="menu">
            <div className="menu_container">
                <div className="menu_search">
                    <input type="text" placeholder="Busque lugares.." className="menu_search-input" />
                    <img src="" alt="" className="menu_search-img" />
                </div>
            </div>
        </div>
    )
}
